(14, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/antonyms-mcqs/antonym-expand-_____________\" rel=\"bookmark\">Antonym of EXPAND is ________</a>?</strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. Congest B. ConcludeC. Convert&nbsp;D. Condense</p>', 'D', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(15, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/synonyms-mcqs/write-the-synonym-of-admonish\" rel=\"bookmark\">Write the synonym of &ldquo;admonish&rdquo;?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. defeat&nbsp; B. defend&nbsp; C. destroy&nbsp; D. counsel</p>', 'D', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(16, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/synonym-of-word-luscious\" rel=\"bookmark\">synonym of word Luscious:</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. Loathe&nbsp; B. Succulent<strong>&nbsp;&nbsp;</strong>C. Abet&nbsp; D. Unappetizing</p>', 'B', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(17, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/synonym-of-abhor\" rel=\"bookmark\">Synonym of abhor?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. love&nbsp; B. hate&nbsp; C. prefer&nbsp; D. admire</p>', 'B', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(18, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/the-collins-dictionarys-word-of-the-year-for-2022-is-__________\" rel=\"bookmark\">The Collins Dictionary&rsquo;s word of the year for 2022 is: __________?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. Moribund&nbsp; B. Vax&nbsp;&nbsp;C. permacrisis<strong>&nbsp;&nbsp;</strong>D. Succulent</p>', 'C', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(19, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/can-you-repair-_____-compter-in-liams-office-its-not-working\" rel=\"bookmark\">Can you repair _____ compter in Liam&rsquo;s office? It&rsquo;s not working.</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. a<strong>&nbsp;&nbsp;</strong>B. the<strong>&nbsp;&nbsp;</strong>C. an&nbsp; D. none of these</p>', 'B', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(20, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/fill-in-the-blinks-mcqs/everyone-who-works-in-this-department-uses-___________-computer\" rel=\"bookmark\">Everyone who works in this department uses ___________ computer.</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. a<strong>&nbsp;&nbsp;</strong>B. the&nbsp; C. an&nbsp; D. none of these.</p>', NULL, '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(21, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/synonyms-mcqs/xenzia-is-the-synonym-of-__________\" rel=\"bookmark\">&ldquo;Xenzia&rdquo; is the synonym of __________?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. Extrovert&nbsp;&nbsp;B. Reserved<strong>&nbsp;&nbsp;</strong>C. Outspoken&nbsp; D. Gregarious</p>', 'B', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(22, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/idioms-and-phrases-mcqs/bring-forward-means\" rel=\"bookmark\">Bring forward means?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. Produce<strong>&nbsp;&nbsp;</strong>B. Show up&nbsp; C. Clarify&nbsp; D. None of These</p>', 'A', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(23, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/antonyms-mcqs/antonym-of-artificial-is-______________\" rel=\"bookmark\">Antonym of ARTIFICIAL is ______________?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs\" style=\"float:right\" />A. Vice&nbsp;<strong> &nbsp;</strong>B. Quality&nbsp; C. Asset&nbsp; D. Purity</p>', 'A', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(24, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/active-and-passive-voice-mcqs/change-the-voice-set-the-thief-to-catch-the-thief\" rel=\"bookmark\">Change the voice &ldquo;Set the thief to catch the thief&rdquo;.</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs/page/2\" style=\"float:right\" />A. Let the thief to catch the thief&nbsp;&nbsp;B. Let the thief be set to catch the thief<strong>&nbsp; &nbsp;</strong>C. Thief is set to catch the thief&nbsp; D. None of These</p>', 'B', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(25, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/prepositions-mcqs/a-black-and-white-cow-________-grazing-in-the-field\" rel=\"bookmark\">A black and white cow ________ grazing in the field.</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs/page/2\" style=\"float:right\" />A. is<strong>&nbsp; &nbsp;</strong>B. are&nbsp; C. were&nbsp; D. None of These</p>', 'A', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(26, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/english-mcqs/fill-in-the-blinks-mcqs/he-is-_________-doctor\" rel=\"bookmark\">He is _________ doctor.</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs/page/2\" style=\"float:right\" />A. a<strong>&nbsp;&nbsp;</strong>B. an&nbsp; C. the&nbsp; D. no article</p>', 'A', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
(27, '<p><strong><a href=\"https://pakmcqs.com/english-mcqs/fill-in-the-blinks-mcqs/we-gave-_________a-meal\" rel=\"bookmark\">We gave _________a meal.</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/english-mcqs/page/2\" style=\"float:right\" />A. at the visitors&nbsp; B. for the visitors&nbsp; &nbsp;C. the visitors&nbsp;<strong>&nbsp;</strong>D. None of These</p>', 'C', '1', 2, 1, 1, 1, '1679988982', NULL, '2023-03-28 02:36:22', '2023-03-28 02:36:22'),
