(99, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u445\" rel=\"bookmark\">حضورؐ کے چچا حضرت عباس ؓ کی نماز جنازہ کس نے پڑھائی تھی ؟</a></strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>حضرت عمر فاروقؓ .❶&nbsp; حضرت ابو بکر&nbsp;ؓ .❷&nbsp;&nbsp;حضرت عثمان&nbsp;ؓ .<strong>❸&nbsp;&nbsp;</strong>حضرت علی&nbsp; .❹</p>', '2', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:34', '2023-03-29 01:14:34'),
