(102, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u442\" rel=\"bookmark\">بتائیے کس صحابی نے حضرت جبرائیلؑ کی زیارت کی تھی اور بے ہوش ہو کر گر پڑے تھے _______؟</a>&nbsp;</strong>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong>حضرت زیدؓ بن حارث .❷&nbsp; حضرت امیر حمزہؓ .❸&nbsp; حضرت سعدؓ بن ابی وقاص&nbsp; .❹حضرت حمزہؓ بن عبدالمطلب&nbsp; .<strong>❶</strong></p>', '4', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(103, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u441\" rel=\"bookmark\">حضرت موسیٰ کی والدہ نے جب آپ علیہ سلام کے تابوت کو دریا نیل میں ڈال دیا پھر کتنے دنوں بعد آپ کی شکل دیکھی _______ ؟</a></strong><br />\r\nدو دن بعد .❶&nbsp;&nbsp;تین دن بعد<strong> .❷&nbsp;&nbsp;</strong>سات دن بعد .❸&nbsp; ان میں سے کوئ نہیں&nbsp; .❹</p>\r\n\r\n<p>&nbsp;</p>', '1', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(104, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/u437\" rel=\"bookmark\">حضرت ابرہیم علیہ السلام کا نام قرآن مجید کی کس سورة میں سب سے ذیادہ بار آیا ہے_________؟</a>&nbsp;</strong></p>\r\n\r\n<p>سورة آل بقرہ<strong> .❶</strong>سورة آل عمران .❷سورة آل ابر ہیم .❸سورة آل حج .❹</p>\r\n\r\n<p>&nbsp;</p>', '4', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(105, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u436\" rel=\"bookmark\">غزوہ حنین کے موقع پر حضور صلی اللہ تعالیٰ علیہ وآلہ وسلم نے کس صحابیؓ کو بنو ہوازن کے لوگوں میں ان کے لشکری روپ میں جاکر معلومات حاصل کرنے کے لیے بیھجا تھا ______ ؟</a></strong></p>\r\n\r\n<p>&nbsp;حضرت عبد اللہ بن ابی حدرد ؓ<strong> .❶</strong>حضرت انسبنابی مرثد ؓ .❷حضرت حباب بن المند ؓ .❸حضرت سعد بن عبادہ ؓ .❹</p>\r\n\r\n<p>&nbsp;</p>', '4', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(106, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u434\" rel=\"bookmark\">حضرت عبدالرحمن بن عوف ؓ نے انتقال سے پہلے اپنے مال میں سے کتنا مال الللہ کی رہ میں خرچ کرنے کی وصیت کی تھی ___________ ؟</a></strong></p>\r\n\r\n<p>&nbsp;تیس ہزار دینار .❶&nbsp; چالیس ہزار دینار .❷&nbsp;پچاس ہرار دینار <strong>.❸&nbsp;</strong>ایک لاکھ دینار&nbsp; &nbsp;.❹</p>\r\n\r\n<p>&nbsp;</p>', '2', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(107, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u433\" rel=\"bookmark\">حضورؐ نے قریش کے ایک تجارتی قافلے کو روکنے کے لیے بواط کو (غزوہ بواط) روانہ ہوئے تو اس وقت حضورؐ نے مدینہ میں اپنا قائم مقام کس کو مقرر کیا ________ ؟</a></strong>&nbsp;<img src=\"https://pakmcqs.com/category/urdu-general-knowledge/page/2\" style=\"float:right\" /></p>\r\n\r\n<p>حضرت سعد بن عبادہ ؓ .❶حضرتسعدبن معاذ ؓ <strong>.❷</strong>حضرت معاذ بن جبل ؓ .❸حضرت زبیر ابن العوام ؓ .❹</p>\r\n\r\n<p>&nbsp;</p>', '1', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(108, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u432\" rel=\"bookmark\">حضرت عمرفاروقؓ نے ایرانیوں کی سلطنت کے خاتمے کے لیے جو اسلامی لشکر تیار کیا تھا اُس لشکر میں بدری صحابہؓ کی تعداد کیا تھی _______؟</a></strong><br />\r\nپچانوے بدری صحابہؓ .❶ستانوے بدری صحابہؓ .❷آٹھانوے بدری صحابہؓ .❸ننانوے &nbsp;بدری&nbsp;صحابہؓ<strong> .❹</strong></p>\r\n\r\n<p>&nbsp;</p>', '3', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(109, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u431\" rel=\"bookmark\">جنگ بدر میں ابوجہل کے قتل کے بعد حضورؐ نے ان کی تلوار کس صحابیؓ کو عطا فرمائی ________ ؟</a></strong><br />\r\nحضرت زبیر ابن العوام ؓ .❶حضرت عبداللہ بن مسعودؓ<strong> .❷</strong>حضرت ابو دجانہؓ .❸حضرت سعد بن ابی وقاصؓ .❹</p>\r\n\r\n<p>&nbsp;</p>', '1', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(110, '<hr />\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u430\" rel=\"bookmark\">حضورؐ نے کس سورة کے بارے میں کہا ہے کہ وہ جس گھر میں پڑھی جائے تو وہاں سے شیطان بھاگ جاتا ہے ________ ؟</a></strong>&nbsp;</p>\r\n\r\n<p><img src=\"https://pakmcqs.com/category/urdu-general-knowledge/page/3\" style=\"float:right\" />سورة جن .❶سورة یسن .❷سورة الرحمن .❸سورة البقرہ<strong> .❹</strong></p>', '3', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(111, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u429\" rel=\"bookmark\">اس مشہور ہستی کا نام بتائیے جو روزانہ تین سو ( یا چار سو) رکعات نفل نماز ادا کرتے اور تیس ہزار مرتبہ &ldquo;سبحان اللہ&rdquo; کی تسبیح پڑھا کرتے تھے _______ ؟</a></strong>&nbsp;</p>\r\n\r\n<p>حضرت نوفل بن حارث ؓ .❶حضرت فضل ابن عباس ؓ .❷حضرت عبد اللہ بن عباس ؓ .❸حضرت جنید بغدادی رحمتہ اللہ علیہ<strong> .❹</strong></p>\r\n\r\n<p>&nbsp;</p>', '3', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(112, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u427\" rel=\"bookmark\">امام اعظم ابو حنیفہ رحمتہ اللہ علیہ نے زندگی میں کتنے حج کیے _________ ؟</a></strong></p>\r\n\r\n<p>&nbsp;<img src=\"https://pakmcqs.com/category/urdu-general-knowledge/page/3\" style=\"float:right\" />51 .❶ 52 .❷ 53 .❸&nbsp;55<strong> .❹</strong></p>', '4', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(113, '<p>&nbsp;</p>\r\n\r\n<p><strong><a href=\"https://pakmcqs.com/urdu-general-knowledge/islamiyat-urdu/u422\" rel=\"bookmark\">سب سے پہلے کس کا اسم حضورؐ کے اسم مبارک پر رکھا گیا _________ ؟</a></strong></p>\r\n\r\n<p>محمد بن ابوبکرؓ .❶محمد بن سیرینؓ .❷محمد بن عاصمؓ .❸محمد بن ابی عامرؓ<strong> .❹</strong></p>\r\n\r\n<p>&nbsp;</p>', '3', '1', 2, 2, 1, 1, '1680070474', NULL, '2023-03-29 01:14:35', '2023-03-29 01:14:35'),
(114, '<p><strong><a href=\"https://pakmcqs.com/everyday-science-mcqs/tibia-bone-found-____________\" rel=\"bookmark\">Tibia is a bone found in the ____________?</a></strong><br />\r\nA. Skull B. Arm&nbsp;&nbsp;C. Leg<strong>&nbsp;&nbsp;</strong>D. Face</p>', 'C', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(115, '<p><strong><a href=\"https://pakmcqs.com/everyday-science-mcqs/largest-gland-human-body\" rel=\"bookmark\">Which is the largest gland in the human body?</a></strong><br />\r\nA. Thyroid&nbsp;&nbsp;B. Liver<strong>&nbsp;&nbsp;</strong>C. Pancreas&nbsp; D. None of these</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36');
INSERT INTO `questions` (`id`, `question`, `correct_answer`, `type`, `class_id`, `subject_id`, `chapter_id`, `term_id`, `current_time`, `difficulty_level`, `created_at`, `updated_at`) VALUES
(116, '<p><strong><a href=\"https://pakmcqs.com/everyday-science-mcqs/water-maximum-density-at____________\" rel=\"bookmark\">Water has maximum density at____________?</a></strong><br />\r\nA. 0&deg;C&nbsp;&nbsp;B. 4&deg;C<strong>&nbsp;&nbsp;</strong>C. 4&deg; K&nbsp; D. 4.8&deg;C</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(117, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/scientific-study-livings-called\" rel=\"bookmark\">The scientific study of livings is called?</a></strong><br />\r\nA. Anatomy&nbsp;&nbsp;B. Biology<strong>&nbsp;&nbsp;</strong>C. Geology&nbsp; &nbsp;D. Zoology</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(118, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/word-biology-derived-from_________-word\" rel=\"bookmark\">The word &ldquo;BIOLOGY&rdquo; has been derived from_________ word?</a></strong><br />\r\nA. Latin&nbsp; B. English&nbsp;&nbsp;C. Greek&nbsp;<strong>&nbsp;</strong>D. French</p>', NULL, '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(119, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/according-modern-system-taxonomy-living-organisms-classi%ef%ac%81ed\" rel=\"bookmark\">According to modern system of taxonomy, living organisms have been classiﬁed into?</a></strong><br />\r\nA. Three Kingdoms&nbsp;&nbsp;B. Five Kingdoms<strong>&nbsp;&nbsp;</strong>C. Two Kingdoms&nbsp; D. Six Kingdoms</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(120, '<p><br />\r\n&nbsp;<strong><a href=\"https://pakmcqs.com/biology-mcqs/kingdom-protoctista-includes____________\" rel=\"bookmark\">Kingdom Protoctista includes____________</a>?</strong></p>\r\n\r\n<p>A. Fungi&nbsp; B. Prokaryotes&nbsp;&nbsp;E. protists<strong>&nbsp;&nbsp;</strong>D. Piantae</p>\r\n\r\n<p>&nbsp;</p>', 'E', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(121, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/kingdom-fungi-includes_______________\" rel=\"bookmark\">Kingdom Fungi includes_______________?</a></strong><br />\r\nA. A cellular, eukaryotic organisms&nbsp; B. Non-chlorophylls, multicellular eukaiyotlc organisms&nbsp; C. Non-chlorophylls, multicellular,thailophytic organisms&nbsp;&nbsp;D. both B and C</p>', 'D', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(122, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/earthworm-included-in_____________\" rel=\"bookmark\">Earthworm is included in_____________?</a></strong><br />\r\nA. Kingdom Plantae&nbsp; B. Kingdom Protoctista&nbsp; C. Kingdom Monera&nbsp;&nbsp;D. Kingdom Animalia</p>', 'D', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:36', '2023-03-30 00:20:36'),
(123, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/study-organisms-inhabiting-sea-ocean-physical-chemical-characteristics-environment\" rel=\"bookmark\">The Study of organisms inhabiting the sea and Ocean and the physical and chemical characteristics of their environment is:</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/biology-mcqs\" style=\"float:right\" />A. Social Biology&nbsp;&nbsp;B. Marine Biology<strong>&nbsp;&nbsp;</strong>C. Environmental Biology&nbsp; D. Fresh Water Biology</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(124, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/branch-organisms-life-cycle-mode-transmission-interaction-hosts-studied\" rel=\"bookmark\">The branch in which organism&rsquo;s life cycle, mode of transmission and interaction with their hosts are studied is:</a></strong>&nbsp;</p>\r\n\r\n<p>A. Anatomy&nbsp; B. Physiology&nbsp;&nbsp;C. Parasitology<strong>&nbsp;&nbsp;</strong>D. Social Biology</p>', 'C', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(125, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/molecules-living-matter-provide-building-blocks-mostly-based\" rel=\"bookmark\">The molecules of living matter that provide building blocks are mostly based on:</a></strong><br />\r\nA. Carbon<strong>&nbsp;&nbsp;</strong>B. Nitrogen&nbsp; C. Hydrogen&nbsp; D. Ammonia</p>', 'A', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(126, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/human-blood-example-of__________\" rel=\"bookmark\">Human blood is an example of__________?</a></strong></p>\r\n\r\n<p>A. Organelle&nbsp;&nbsp;B. Tissues<strong>&nbsp;&nbsp;</strong>C. Organic compound&nbsp; D. Inorganic compounds</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(127, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/different-chemical-arrangements-formation-complex-molecules-life-emerges-level\" rel=\"bookmark\">With different chemical arrangements and formation Of complex molecules, the life emerges on the level of the ?</a></strong><br />\r\nA. Cells&nbsp;<strong>&nbsp;</strong>B. Tissues&nbsp; C. Organs&nbsp; D. Organ System</p>', 'A', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(128, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/organelles-are_______________\" rel=\"bookmark\">Organelles are_______________?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/biology-mcqs/page/2\" style=\"float:right\" />A. Unicellular structures&nbsp; B. Multi-cellular structures&nbsp;&nbsp;C. Sub-cellular structures<strong>&nbsp;&nbsp;</strong>D. Non-cellular structures</p>', 'C', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(129, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/functional-unit-dna-is____________\" rel=\"bookmark\">Functional unit of DNA Is____________?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/biology-mcqs/page/2\" style=\"float:right\" />A. Nucleus&nbsp;&nbsp;B. Genes<strong>&nbsp;&nbsp;</strong>C. Chromosomes&nbsp; D. Nucleolus</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(130, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/various-tissue-types-combine-make-up__________\" rel=\"bookmark\">Various tissue types combine to make up__________?</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/biology-mcqs/page/2\" style=\"float:right\" />A. Cells&nbsp;&nbsp;B. Organs<strong>&nbsp;&nbsp;</strong>C. Organ System&nbsp; D. Organelles</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(131, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/two-populations-different-species-living-interacting-area-form\" rel=\"bookmark\">Two or more populations of different species living and interacting in the same area form</a></strong>&nbsp;</p>\r\n\r\n<p>A. Biosphere&nbsp;&nbsp;B. Community<strong>&nbsp;&nbsp;</strong>C. Population System&nbsp; D. Ecosystem&nbsp; E. Species</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(132, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/group-similar-cells-perform-specific-function\" rel=\"bookmark\">A group of similar cells that perform a specific function is:</a></strong><br />\r\n<img src=\"https://pakmcqs.com/category/biology-mcqs/page/2\" style=\"float:right\" />A. Organ&nbsp;&nbsp;B. Tissues<strong>&nbsp;&nbsp;</strong>C. Organelle&nbsp; D. Organ System</p>', 'B', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(133, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/following-example-molecule\" rel=\"bookmark\">Which of the following is an example of &ldquo;molecule&rdquo;?</a></strong>&nbsp;</p>\r\n\r\n<p>A. Chloroplast&nbsp; B. A Nerve Cell&nbsp;&nbsp;C. DNA<strong>&nbsp;&nbsp;</strong>D. Hydrogen</p>', 'C', '1', 2, 8, 1, 1, '1680153636', NULL, '2023-03-30 00:20:37', '2023-03-30 00:20:37'),
(134, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/following-example-molecule\" rel=\"bookmark\">Which of the following is an example of &ldquo;molecule&rdquo;?</a></strong><br />\r\nA. Chloroplast&nbsp; B. A Nerve Cell&nbsp;&nbsp;C. DNA<strong>&nbsp;&nbsp;</strong>D. Hydrogen</p>', 'C', '1', 2, 8, 2, 1, '1680157836', NULL, '2023-03-30 01:30:36', '2023-03-30 01:30:36'),
(135, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/group-similar-inter-breeding-organisms-constitutes\" rel=\"bookmark\">A group of very similar inter breeding organisms constitutes?</a></strong><br />\r\nA. Biosphere&nbsp; B. Ecosystem&nbsp; C. Population&nbsp;&nbsp;D. Species</p>', 'D', '1', 2, 8, 2, 1, '1680157836', NULL, '2023-03-30 01:30:36', '2023-03-30 01:30:36'),
(136, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/members-one-species-inhabiting-form__________\" rel=\"bookmark\">Members of one species inhabiting the same are form__________?</a></strong><br />\r\nA. Species&nbsp; B. Community&nbsp; C. Ecosystem&nbsp;&nbsp;D. Population</p>', 'D', '1', 2, 8, 2, 1, '1680157836', NULL, '2023-03-30 01:30:36', '2023-03-30 01:30:36'),
(137, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/basis-collected-facts-%ef%ac%81gures-scientist-formulates-factitive-statement-called\" rel=\"bookmark\">On the basis of collected facts and ﬁgures, a scientist formulates a factitive statement called:</a></strong>&nbsp;</p>\r\n\r\n<p>A. Observation&nbsp; B. Research work&nbsp;&nbsp;C. Hypothesis&nbsp;<strong>&nbsp;</strong>D. Inductive Reasoning</p>', 'C', '1', 2, 8, 2, 1, '1680157836', NULL, '2023-03-30 01:30:36', '2023-03-30 01:30:36'),
(138, '<p><strong><a href=\"https://pakmcqs.com/biology-mcqs/robert-hooke-discovered_____________\" rel=\"bookmark\">Robert Hooke discovered_____________?</a></strong><br />\r\nA. Nucleus&nbsp; B. Mitochondria&nbsp;&nbsp;C. Cell&nbsp;<strong>&nbsp;</strong>D. DNA</p>', 'C', '1', 2, 8, 2, 1, '1680157836', NULL, '2023-03-30 01:30:36', '2023-03-30 01:30:36'),
