(734, '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">At equilibrium, a mixture of N2, H2, and NH3 gases at 500&deg;C is determined to consist</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">0.602 mol/ dm3 of N2, 0.420 mol/ dm3 of H2, and 0.113 mol/dm<sup>3</sup> of NH<sub>3</sub>, What is the</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">equilibriunm constant for the reaction at this temperature?</span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,&quot;sans-serif&quot;\">N2(g)&nbsp;&nbsp;&nbsp; +&nbsp;&nbsp; 3H2(g) ----------------&gt;2NH3 (g)</span></span></p>', NULL, '3', 2, 7, 9, 1, '1684217574', 'Easy', '2023-05-16 01:12:54', '2023-05-16 01:12:54'),
